    dist.sort()

    # Check if minimum number of turns is greater than maximum number of turns
    if dist[-1] > dist[-2]:
        return 'War'

    # If maximum number of turns is greater than smallest number of turns
    # -> B is not an issue, and B is updated to a different number
    # In this case we want to update B
    B = max(M, N)

    if B >= dist[-1]:
        B = dist[-1]

    # Find all indexes of the minimum number of turns
    i = 0
    while i < len(dist):
        if dist[i] >= B:
            break
        i += 1

    # if we have found B, we can now update the minimum number of turns
    if i < len(dist):
        B = dist[i]

    # if we haven't found anything, then B is not an index
    if i < len(dist):
        B = -1

    # if we are not at the last index, then B is not at last index
    if i > len(dist) - 1:
        B = -1

    # update B by checking if B is a solution
    if dist[i] == B:
        return 'War'
    else:
        return 'No War'

