class Solution:
    def isPalindrome(self, s: str) -> bool:
        if len(s) == 0:
            return False

        # Remove white spaces
        s = s.replace(" ", "")
        # Search all letters in alphabet and make it into a character list
        chars = []
        for ch in s:
            chars.append(ord(ch) - ord("a") + 1)
        # Initialize a palindrome
        isPalindrome = True
        for idx in range(len(chars) // 2):
            # If the second half is not a palindrome, then don't check the next half.
            if not isPalindrome:
                break
            # If the second half is a palindrome, then it is a palindrome
            if chars[idx] == chars[idx + 1]:
                isPalindrome = False
        return isPalindrome

