        return min_dist

    def find_max_distance():
        max_dist = 0
        for i in range(N):
            for j in get_neighbours(i):
                dist = get_distance(A1, A2, i, j)
                if dist > max_dist:
                    max_dist = dist
        return max_dist

    return str(find_min_distance() + find_max_distance())

